import React from 'react';
import web from '../src/images/down.svg';
import Common from './Common';
const Home = () => {
    return (
                  <>
                      <Common
                          name="Grow Your business with"
                          imgsrc={web}
                          visit="/service"
                          btname="Get Started"  
                      />
                  </>

    );
}

export default Home;
